import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Vendor_Navbar from '../templates/Vendor_Navbar';
export default function Vendor_Statiscits() {
    const navigate = useNavigate();
    const [email, setEmail] = useState(localStorage.getItem("email"));
    const [users, setUsers] = useState([]);
    const [Ordersplaced, SetOrders] = useState(0);
    const [Pendingplaced, Setpending] = useState(0);
    const [Completed, setCompleted] = useState(0);
    const [status, setStatus] = useState("");
    const Nuser = {
        email: email,
    }
    console.log(email);
    useEffect(() => {
        axios
            .post("http://localhost:4000/user/vendor_orders", Nuser)
            .then((response) => {
                // console.log(response.data);
                setUsers(response.data);
            })
            .catch((error) => {
                console.log(error);
            });



    }, []);

    const making = (stat)=> {

         if (stat === "PLACED") {
                console.log(stat)
                SetOrders(1);
            }
            else if (stat === "COMPLETED") {
                console.log(stat)
                setCompleted( 1);
            }
            else {
                console.log(stat)
                Setpending( 1);
            }
            console.log(Ordersplaced, Completed, Pendingplaced);
    }
    // useEffect(() => {
        // console.log("these are users",users)
    const fun = () => {
        users.map((user,ind) => {

            console.log(user.status);
            making(user.status);

        })
    }
    // }, [])



    return <div>
        <Vendor_Navbar />
        <h1><center> Statistics</center></h1>
        <Button variant="contained" color="success" onClick={() => { fun(); }}>
            statistics refresh
        </Button>

    </div>;
}
